import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './modules/css/reset.css'
import './css/index.css'
import './modules/scss/config.scss'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>
);
